import React from 'react';
import image1 from './pictures/1.png';

function AboutUs() {
  return (
    <div className="grid grid-cols-1 gap-4 overflow-y-auto h-screen">
    <div className="flex flex-col items-center justify-center">
      <img src="your-image1.jpg" alt="Image 1" className="w-full object-cover rounded-lg" />
      <p className="text-lg mt-4">Image 1 Text</p>
    </div>
    <div className="flex flex-col items-center justify-center">
      <img src="your-image2.jpg" alt="Image 2" className="w-full object-cover rounded-lg" />
      <p className="text-lg mt-4">Image 2 Text</p>
    </div>
    <div className="flex flex-col items-center justify-center">
      <img src="your-image3.jpg" alt="Image 3" className="w-full object-cover rounded-lg" />
      <p className="text-lg mt-4">Image 3 Text</p>
    </div>
    {/* Add more divs as needed */}
  </div>
);
}


export default AboutUs;
